import styled from "styled-components";

export const HeaderContainer = styled.div`
    height: 70px;
    width: 100%;
    position: fixed;
    border: 1px solid;
    background: #000;
    display: flex;
    align-items: center;
    justify-content: space-between;
    z-index: 5;
`
export const Btn = styled.button`
    font-size:15px;
    line-height:2.5rem;
    border-radius:5px;
    background-color:white;
    border:0;
    &:hover, :focus {
        background: #fff;
        color: gray;

}
`
